import React from 'react';
import { useNavigate } from 'react-router-dom';

const MyBookingSidebar = ({ cartItems }) => {
    const navigate = useNavigate(); // Initialize navigate function

    const handleCheckout = () => {
        navigate('/login'); // Navigate to the registration page
    };

    return (
        <div className="my-booking-sidebar">
            <h2>My Booking</h2>
            {cartItems.map((item, index) => (
                <div key={index}>
                    <p>{item.name} - {item.quantity} pcs</p>
                    <p>{item.dateRange.startDate.toLocaleDateString()} - {item.dateRange.endDate.toLocaleDateString()}</p>
                </div>
            ))}
            <button>View Cart</button>
            <button onClick={handleCheckout}>Checkout</button> {/* Add onClick to Checkout button */}
        </div>
    );
};

export default MyBookingSidebar;
